  WOODS, Edward Richard and PROBY, Joanna Margaret (cont...)
  Director Development Cooperation (1991-93); Ambassador, Moscow (1993-95); and Ambassador, Paris
  (1995-).
  Before her marriage Joanna worked for Sotheby's and for the British Foreign Office. She has since
  qualified as a teacher of English as a second language (DipTESL, Victoria, 1980). She graduated BA
  from Victoria University (Senior Scholar) and PhD from Moscow State University.
  01> WOODS, James Christopher
  b 28.01.1972
  James b. at London, England. He had his primary education in Iran, Bahrain, New Zealand and
  England and his secondary education at Winchester College, England. He graduated BA (Hons) in
  Law from Trinity College, Cambridge, England, and is now a management consultant with Andersen
  Consulting in Paris. He plays the trombone and the piano.
  02> WOODS, Samuel Richard
  b 07.05.1973
  Samuel b. at Wellington. Samuel had his primary education in Iran, Bahrain, New Zealand and
  England and his secondary education at Winchester College, England, where he was head of his
  house and also captain of swimming in 1990-91. He graduated BA(1st Class Hons) from Magdalen
  College, Oxford, and is a management consultant with McKinsey and Co. He is currently studying
  for his MBA at INSEAD, Fontainbleau, France. He plays the trumpet.
  62> WOODS, Christopher Samuel m on 15.01.1977 to HOWARD, Katherine
  Isabella (Kathy)
  b 15.01.1943
  b 17.06.1952
  Christopher b. at Napier and m, at the Anglican Church, Marlow, England. Katherine, d/o the Hon
  Edmund Bernard Carlo Howard (retired diplomat) and Cecile Geoffroy-Dechaume b, at London. Address:
  Holy Trinity Vicarage, Parr Mount, St Helen's, Merseyside WA9 IBW, England.
  Christopher had his prep schooling in England. He returned to New Zealand in 1955 with his parents
  and attended Christ's College, Christchurch where he was House Prefect in Harper House and led the
  School Band. He graduated BA from Canterbury University. In 1967 he went to England where he was
  employed by Associated Book Publishers as their sales representative in all the universities of
  Western Europe from Trondheim in Norway to Valetta in Malta. In 1970 he joined Reuters as man in
  charge of their economic news service to all of Africa (South of the Sahara, except South Africa).
  He returned to Wellington in 1973 to become Sales Manager for A H & A W Reed, publishers. Some
  months later he had a sort of 'Damascus Road' experience which led him to return to England to
  offer for ordination. Upon acceptance he trained for 2 years at Queen's College, Birmingham. After
  serving a curacy in a Liverpool parish he was appointed as vicar of a parish in a deprived area of
  the industrial town of St Helen's where there is 40% unemployment. Despite offers of easier
  positions, Christopher and Kathy have chosen to stay in Parr Mount where the parish life has been
  greatly enlivened by their joint ministry. With teams from his parish, Christopher is in increasing
  demand to visit other parishes as far away as London on behalf of the Anglican Renewal Movement and
  the Decade of Evangelism
