  b 29.11.1977
  Isabella b. at Liverpool, England. In 1989 Isabella won a scholarship to Rossall Co-ed Public
  School. In 1991 at age 13 she passed grade 8 flute exam with distinction and grade 4 piano.
  She is now studying towards her BA at the University of Edinburgh in Scotland.
